    console.log("Main has components. Somehow its beeing passed to definition")
    return (<div>
    <Switch>

     <Route exact path ="/" component ={DictionaryList} />
     <Route 
        path ="/definition" 
        render={() => <Definition wordData={props.wordData}/>}
     />
    </Switch>

      {/* <DictionaryList />
